import React, {Component} from 'react'
import {Link} from 'react-router-dom'

class WelcomeComponent extends Component {
    render() {
        return (
            <>
            <div className="container">
                Welcome to my App . {this.props.match.params.name}. See Todo <Link to="/todo">Here</Link>
            </div>
            <div className="container"> <button className="btn btn-success" onClick={this.retrieveMessage}>Message will be displayed here</button></div>
           </> 
        )
    }
}
export default WelcomeComponent;
